DROP PROCEDURE IF EXISTS `sp_change_password`;
delimiter ;;
CREATE PROCEDURE `sp_change_password`(IN myuser varchar(100), IN new_pass VARCHAR(100))
BEGIN
  #Routine body goes here...
	SET @defpass = md5(new_pass);
	UPDATE usuario set clave = @defpass WHERE usuario = myuser;
	 
END
;;
